import React from 'react';
import './App.css';

class App extends Component {
  constructor(props){
      super(props);
      this.state = {
        characters: null,
      }
  }

  componentDidMount(){
    fetch('https://www.anapioficeandfire.com/api/characters?page=1&pageSize=50')
      .then(res => {
        return res.json();
      })
      .then(res => {
        console.log(res)
        this.setState({
          characters: res
        })
      })
      .catch(error => {
        console.log(error)
      })
  }

  render(){
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
